function check_market($markets, $key){
    foreach ($markets as $market) {
        if ($market['key'] == $key) {
            return $market;
            break;
        }
    }
    return false;
}

function check_outcome($outcomes, $name){
    foreach ($outcomes as $outcome) {
        if ($outcome['name'] == $name) {
            return $outcome;
            break;
        }
    }
    return false;
}


